	add("dirtsider", "{\"term\":\"dirtsider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dirtside|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who lives on the surface of a planet or moon, as opposed to in space\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Jerry Oltion, \u0027Where Sea Meets Sky\u0027, Pocket Books (1998), ISBN 0671024000, [http://books.google.com/books?id\u003dQtBp7B1WVi8C\u0026amp;pg\u003dPA23\u0026amp;dq\u003d%22dirtsider page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He really \u0027hadn\u0027t\u0027 been in space before. You can always tell a \u0027\u0027dirtsider\u0027\u0027 by the twinkle in their eyes at the idea of seeing their planet from above\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Roger MacBride Allen, \u0027The Depths of Time\u0027, Random House (2001), ISBN 9780553574975, [http://books.google.com/books?id\u003dX74Yo96CcxkC\u0026amp;q\u003d%22dirtsiders%22\u0026amp;dq\u003d%22dirtsiders%22 page 378\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"So you tell me, Senyor Parrige, how many habitats would be willing to take on their maximum possible population load in the form of half-starved, uneducated, indigent, disease-ridden \u0027\u0027dirtsiders\u0027\u0027 who know nothing of habitat life and have no skills that are of much use in space\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Shayla Kersten, \u0027Angel Moon\u0027, Ellora\u0027s Cave (2010), ISBN 9781419925146, [http://books.google.com/books?id\u003dP5qoLWNdejcC\u0026amp;pg\u003dPA52\u0026amp;dq\u003d%22dirtside\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dirtsider\u0026amp;f\u003dfalse page 52\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As a \u0027\u0027dirtsider\u0027\u0027, the idea of dying in the cold of space terrified him, though he\u0027d never admit it to his space-loving mate\", \"priority\":8}]}, \"synonyms\":{}}");

